import React from 'react';
import '../style.css';

function Hero() {
    return(
        <section classNameName="lead">
        <div classNameName="lead-title">
          <h5 classNameName="bold">Easy, affordable insurance for all bicycles</h5>
          <h1>Protect Your Bike</h1>
          <h5>From Theft or Damage</h5>
          <a classNameName="start-btn uk-button uk-button-default" href="signup.html">Get Started</a>
        </div>
      </section>
    )
};

export default Hero;
